    <style>
      body {
        margin: 0;

        height: 100%;
        overflow: hidden;

        display: grid;

        text-transform: uppercase;
        font-family: arial;
        background-color: black;
        color: white;
      }

      .age {
        font-weight: bold;
        color: white;
        font-size: 250px;
        color: #4433ff;
        -webkit-text-stroke: 3px white;
        text-shadow: 20px 20px 0 white;
        padding: 0 40px;

        position: absolute;
        text-align: right;
        bottom: 0%;
        right: 0%;
      }

      .heading {
        font-weight: bold;
        color: white;
        width: 50%;
        font-size: 64px;
        color: greenyellow;
        -webkit-text-stroke: 2px white;
        text-shadow: 5px 5px 0 white;
        padding: 20px;

        position: absolute;
        text-align: left;
        left: 0%;
      }

      .details {
        border: 3px solid white;
        margin: 20px;

        width: 240px;

        font-weight: bold;
        color: white;
        font-size: 24px;
        padding: 10px;

        position: absolute;
        text-align: left;
        top: 0%;
        right: 0%;
      }

      p {
        margin: 0;
      }

      hr {
        border: 2px solid white;
      }
